import "./ExpenseItem.css";

export default function ExpenseItem() {
  return (
    <div className="expense-item">
      <div>March 28th</div>
      <div className="expense-ite">
        <h2>Car Insurance</h2>
        <div>$290.00</div>
      </div>
    </div>
  );
}
